            row_number() over (partition by {{ surrogate_key }} order by 1 ) as dbt_audit_pk_row_num
        from ( {{-  a_query  -}} )
        {{ audit_helper.event_time_filter(event_time_props) }}
    ),

    subset_columns_b as (
        select 
            {{ joined_cols }}, 
            {{ surrogate_key }} as dbt_audit_surrogate_key,
