model.analytics.customer_flags.raw_code:
{{
    config(
        materialized='table'
    )
}}

with customer as (

    select * from {{ ref('stg_tpch_customers') }}

),

    orders as (

    select * from {{ ref('stg_tpch_orders') }}

),

    final as (

    select

        customer.customer_key_,
        coalesce(sum(orders.total_price),0) as lifetime_value,
        iff(lifetime_value > 3000000, 'Y', 'N') as is_high_value,
        iff(lifetime_value between 1000000 and 2999999, 'Y', 'N') as is_mid_value,
        iff(lifetime_value between 0 and 999999, 'Y','N') as is_low_value

    from customer
        inner join orders
            on customer.customer_key_ = orders.customer_key
    group by 1
)

select * from final

model.analytics.customer_tier.raw_code:
{{
    config(
        materialized='table'
    )
}}

with customer as (
    select * from {{ ref('stg_tpch_customers') }}
),

orders as (
    select * from {{ ref('stg_tpch_orders') }}
),
final as (
    select
        customer.customer_key_,
        sum(orders.total_price) as lifetime_value,
        case 
            when lifetime_value <= 200000 then 'tier1'
            when lifetime_value > 2000000 then 'tier2'
            when lifetime_value between 1000000 and 1999999 then 'tier3'
            when lifetime_value between 0 and 999999 then 'tier4' 
        end as tier_name
    from customer
        inner join orders
            on customer.customer_key_ = orders.customer_key
    group by 1
)

select * from final

model.analytics.dim_suppliers.raw_code:
{{
    config(
        materialized = 'table'
    )
}}

with supplier as (

    select * from {{ ref('stg_tpch_suppliers') }}

),
nation as (

    select * from {{ ref('stg_tpch_nations') }}
),
region as (

    select * from {{ ref('stg_tpch_regions') }}

),
final as (

    select 
        supplier.supplier_key,
        supplier.supplier_name,
        supplier.supplier_address,
        nation.name as nation,
        region.name as region,
        supplier.phone_number,
        supplier.account_balance
    from
        supplier
    inner join nation
            on supplier.nation_key = nation.nation_key
    inner join region 
            on nation.region_key = region.region_key
)

select * from final

